import React,{Component} from 'react'
import PropTypes from 'prop-types'
import './index.css'


export default class RestaurantDiscription extends Component{
    static propTypes = {
        Announcement:PropTypes.string.isRequired,
    }

    static defaultProps = {
        Announcement:'一些通知事項',
    }

    render(){
        const {Announcement}=this.props
        return (
            <p>{Announcement}</p>)
    }
}
